CREATE TABLE mytable(
   columbary_ID           VARCHAR(30) NOT NULL PRIMARY KEY
  ,cr_vault_number        VARCHAR(11) NOT NULL
  ,cr_full_name           VARCHAR(21) NOT NULL
  ,cr_permanent_residence VARCHAR(60) NOT NULL
  ,cr_mobile_number       VARCHAR(22) NOT NULL
  ,cr_email_address       VARCHAR(35) NOT NULL
  ,cr_date_of_issuance    DATE  NOT NULL
  ,cr_date_of_expiration  DATE  NOT NULL
  ,cr_issuing_party       VARCHAR(30) NOT NULL
  ,first_beneficiary      VARCHAR(20) NOT NULL
  ,second_beneficiary     VARCHAR(18) NOT NULL
  ,third_beneficiary      VARCHAR(21) NOT NULL
  ,fourth_beneficiary     VARCHAR(20) NOT NULL
  ,pa_type_of_p           VARCHAR(19) NOT NULL
  ,pa_amount              INTEGER  NOT NULL
  ,pa_ref_number          INTEGER  NOT NULL
);
